amp Europe l&#8217;un des deux évènements WordPress annuels qui rassemblent des participants venant du monde entier. Cette année, notre CEO Émilie Lebrun et moi-même (Jean-Baptiste, CTO) avons eu le plaisir de nous rendre les 7, 8, 9 et 10 décembre à Nashville pour participer à ce grand évènement international. [&#8230;]\nThe post Retours sur le WordCamp US Nashville 2018 appeared first on Agence WordPress Whodunit.		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:714:\"<p>Le WordCamp US est avec le WordCamp Europe l&#8217;un des deux évènements WordPress annuels qui rassemblent des participants venant du monde entier. Cette année, notre CEO Émilie Lebrun et moi-même (Jean-Baptiste, CTO) avons eu le plaisir de nous rendre les 7, 8, 9 et 10 décembre à Nashville pour participer à ce grand évènement international. [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://www.whodunit.fr/retours-sur-le-wordcamp-us-nashville-2018/\">Retours sur le WordCamp US Nashville 2018</a> appeared first on <a rel=\"nofollow\" href=\"https://www.whodunit.fr\">Agence WordPress Whodunit</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/7tD5pDW7oQI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://www.whodunit.fr/retours-sur-le-wordcamp-us-nashville-2018/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:84:\